import React from "react";
import Navbar from "./Navbar";
import Intro from "./Intro";
import Particles from "react-particles-js";
import { makeStyles } from "@material-ui/core/styles";
import WorkExperience from "./WorkExperience";

// CSS STYLES
const useStyles = makeStyles((theme) => ({
  // making particles span the whole screen. play around with params, enable, valuearea, etc
  particlesCanva: {
    position: "absolute",
    obacity: "0.3",
    width: "100%",
    height: "600px",
  },
  bodyContent: {
    display: "flex",
    flexDirection: "column",
  },
}));

export const Home = () => {
  const classes = useStyles();

  return (
    <div>
      <Navbar />
      <Particles
        canvasClassName={classes.particlesCanva}
        params={{
          particles: {
            number: {
              value: 20,
              density: {
                enable: true,
                value_area: 1000,
              },
            },
            shape: {
              type: "star",
              stroke: {
                width: 1,
                // color: "tomato", // doesn't work?
              },
            },
            size: {
              value: 3,
              random: true,
              animation: {
                enable: true,
                speed: 2,
                size_min: 0.1,
                sync: true,
              },
            },
            // opacity: {
            //   value: 1,
            //   random: true,
            //   anim: {
            //     enable: true,
            //     speed: 1,
            //     opacity_min: 0.1,
            //     sync: true,
            //   },
            // },
          },
        }}
      />
      {/* <div className={classes.bodyContent}> */}
      <Intro />
      <WorkExperience />
      {/* </div> */}
    </div>
  );
};

export default Home;

/* react-particles-js docs https://www.npmjs.com/package/react-particles-js
  type: star or circle
  value property is size of the dots
*/
